
export type SelectColor = "default" | "gray" | "brown" | "orange" | "yellow" | "green" | "blue" | "purple" | "pink" | "red";

export type SelectPropertyResponse = {
    id: string;
    name: string;
    color: SelectColor;
};

export type PostProperties = {
    CreatedTime: {
        id: string,
        type: "created_time",
        created_time: string
    },
    Status: {
        id: string,
        // better status mapping
        status?: SelectPropertyResponse,
        type: "status",
    },
    Tag: {
        id: string,
        type: "multi_select",
        multi_select: Array<SelectPropertyResponse>
    },
    Title: {
        id: string,
        title: Array<RichTextItemResponse>,
        type: 'title'
    },
    Description: {
        id: string,
        rich_text: Array<RichTextItemResponse>,
        type: "rich_text"
    }
}

export type DateResponse = {
    start: string;
    end: string | null;
    time_zone: string;
};

export type RichTextItemResponse = {
    type: "text";
    text: {
        content: string;
        link: {
            url: string;
        } | null;
    };
    annotations: {
        bold: boolean;
        italic: boolean;
        strikethrough: boolean;
        underline: boolean;
        code: boolean;
        color: "default" | "gray" | "brown" | "orange" | "yellow" | "green" | "blue" | "purple" | "pink" | "red" | "gray_background" | "brown_background" | "orange_background" | "yellow_background" | "green_background" | "blue_background" | "purple_background" | "pink_background" | "red_background";
    };
    plain_text: string;
    href: string | null;
} | {
    type: "date";
    date: DateResponse;
} | {
    type: "link_preview";
    link_preview: {
        url: string;
    };
} | {
    type: "page";
    page: {
        id: string;
    };
} | {
    type: "database";
    database: {
        id: string;
    };
};


